import { useState, useEffect, useContext, useRef } from "react";

import axios from "axios";
import swal from "sweetalert";

export default function All_orders() {
  const getallorders = () => {
    axios({
      method: "POST",
      withCredentials: true,
      url: "http://localhost:4000/api/allorders/",
    })
      .then((res) => {
        console.log(res.data.row);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    getallorders();
  });

  return (
    <>
      <div className="page">Here admin can view all orders</div>
    </>
  );
}
